import React from 'react'
import Card from './Body';
import NavScroll from './Navigation';
import Slider from './Slider';


export default function Home() {
  return (
    <div className='row'>
    
    <div><NavScroll/></div>
    <div><Slider/></div>
    <div className='m-3'>
      <Card/>
      <Card/>
      <Card/>
      <Card/>
      </div>

    </div>
  )
}
